import './styles.css';

function SplashScreen() {
  return (
    <div 
      style={{
        display: 'flex',
        flexDirection: 'column',
        height: '100vh',
        alignItems: 'center',
        justifyContent: 'center',
        textAlign: 'center',
        fontSize: '1.5rem',
      }}
    >
      <h2 style={{ marginBottom: '0.5rem' }}>Welcome to GeneSight</h2>
      <p>Loading the Future of Genomic Analysis...</p>
    </div>
  );
}

export default SplashScreen;
